import { Route, Routes } from "react-router-dom";
import { Fragment } from "react/cjs/react.production.min";
import Home from "./Pages/HomePage";

function App() {
  return (
    <Fragment>
      <Routes>
        <Route path="/Home">
          <Home></Home>
        </Route>
        <Route path="/KnowMore">
          <h1>KnowMore</h1>
        </Route>
      </Routes>
    </Fragment>
  );
}

export default App;
